import { Component } from '@angular/core';
import { CommonModule } from '@angular/common';

@Component({
    selector: 'app-experience-timeline',
    standalone: true,
    imports: [CommonModule],
    template: `
    <section id="experience" class="py-24 bg-slate-900/30">
      <div class="max-w-7xl mx-auto px-6">
        <div class="text-center mb-20">
          <h2 class="text-brand-accent font-bold uppercase tracking-widest text-sm mb-4">The Journey</h2>
          <h3 class="text-4xl md:text-6xl font-display font-bold">Experience <span class="text-slate-500 italic">Timeline</span></h3>
        </div>

        <div class="relative">
          <!-- Central Line -->
          <div class="absolute left-1/2 -translate-x-1/2 top-0 bottom-0 w-px bg-gradient-to-b from-brand-accent/50 via-white/10 to-transparent hidden md:block"></div>

          <div class="space-y-20 relative">
            @for (exp of experiences; track exp.company; let even = $even) {
              <div class="flex flex-col md:flex-row items-center gap-8 md:gap-0">
                <!-- Left Side -->
                <div class="flex-1 w-full text-right pr-12 hidden md:block" [class.order-1]="!even" [class.order-3]="even">
                  @if (!even) {
                    <div class="text-brand-accent font-bold mb-2">{{ exp.period }}</div>
                    <h4 class="text-2xl font-bold font-display">{{ exp.role }}</h4>
                    <div class="text-slate-400 font-medium mb-4">{{ exp.company }}</div>
                    <p class="text-slate-500 text-sm leading-relaxed max-w-sm ml-auto">{{ exp.desc }}</p>
                  }
                </div>

                <!-- Center Point -->
                <div class="relative flex-none w-12 h-12 rounded-full bg-slate-900 border-4 border-slate-800 flex items-center justify-center z-10 order-2">
                   <div class="w-2 h-2 rounded-full bg-brand-accent shadow-[0_0_10px_rgba(0,242,255,1)]"></div>
                </div>

                <!-- Right Side -->
                <div class="flex-1 w-full pl-12 order-3 md:order-1" [class.md:text-left]="even" [class.md:order-3]="!even">
                  @if (even || true) { <!-- Mobile always shows here, Desktop conditional -->
                    <div class="md:hidden block">
                       <div class="text-brand-accent font-bold mb-2">{{ exp.period }}</div>
                       <h4 class="text-xl font-bold font-display">{{ exp.role }}</h4>
                       <div class="text-slate-400 font-medium mb-4">{{ exp.company }}</div>
                       <p class="text-slate-500 text-sm leading-relaxed">{{ exp.desc }}</p>
                    </div>
                    <div class="hidden md:block">
                       @if (even) {
                         <div class="text-brand-accent font-bold mb-2">{{ exp.period }}</div>
                         <h4 class="text-2xl font-bold font-display">{{ exp.role }}</h4>
                         <div class="text-slate-400 font-medium mb-4">{{ exp.company }}</div>
                         <p class="text-slate-500 text-sm leading-relaxed max-w-sm">{{ exp.desc }}</p>
                       }
                    </div>
                  }
                </div>
              </div>
            }
          </div>
        </div>
      </div>
    </section>
  `
})
export class ExperienceTimelineComponent {
    experiences = [
        {
            period: '2022 - Present',
            role: 'Senior Frontend Architect',
            company: 'TechGlobal Solutions',
            desc: 'Leading the migration of core banking systems to Angular Standalone with Signals. Defined architectural patterns for cross-platform Ionic apps.'
        },
        {
            period: '2019 - 2022',
            role: 'Lead Angular Developer',
            company: 'AppInnovate',
            desc: 'Developed high-performance hotel booking engines. Specialized in real-time data synchronization and complex RxJS streams.'
        },
        {
            period: '2017 - 2019',
            role: 'Full Stack Developer',
            company: 'StartUp Hub',
            desc: 'Building MVP products with Angular and Node.js. Focused on rapid deployment and modular frontend architecture.'
        }
    ];
}
